import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be rendered by the script
    await page.waitForSelector('.product-card .product-price', { timeout: 5000 });

    // Extract all product prices
    const priceElements = await page.locator('.product-price').all();
    const extractedPrices = [];

    for (const element of priceElements) {
      const priceText = await element.innerText();
      // The innerText might contain the sale price and original price separated by a newline.
      // We only want the first price (the current one).
      const currentPriceText = priceText.split('\n')[0];
      // Remove the dollar sign and convert to a number
      const priceValue = parseFloat(currentPriceText.replace('$', ''));
      if (!isNaN(priceValue)) {
        extractedPrices.push(priceValue);
      }
    }

    // Take a screenshot of the product grid
    const productGrid = await page.locator('.featured-section');
    await productGrid.screenshot({ path: path.join(screenshotsDir, 'step_2_product_prices.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_prices.png'));

    if (extractedPrices.length === 0) {
      throw new Error('No product prices were found on the page.');
    }

    return {
      success: true,
      action: "Extracted all visible product prices from the page.",
      extractedData: {
        prices: extractedPrices,
        productCount: extractedPrices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
